    [],nt"revision_timestamp": "2016-07-27T22:44:32.702912",nt"name": "longleaf-pine-survival-growth-and-recruitment-experiment",nt"isopen":
    false,nt"url": null,nt"notes": "This experiment was to determine mean survivorship,
    growth rate, and recruitment rate of longleaf pine seedlings planted on different
    soil types on the refuge. Open pine habitat management practices required for Red-cockaded
    woodpeckers (RCW) at SDH Noxubee NWR has resulted in minimal regeneration of the
    loblolly pine (Pinus taeda) forest present on the refuge.  The aging forest will
    become degraded as RCW habitat over time if management is not employed to provide
    adequate regeneration.  One of the management possibilities that could improve sustainability
    of RCW habitat is integration of longleaf pine (Pinus palustris) in to the loblolly
    pine forest.  The attributes of longleaf pine, greater drought tolerance, natural
    pest and disease resistance, long-lived, subject to heart rot, and adapted to frequent
    fire during regeneration, make this species a good choice to both increase the resilience
    of the forest and provide quality RCW habitat.  SDH Noxubee NWR does not fall within
    the area typically identified as being the historical range of longleaf pine, but
    it does have environmental conditions conducive to the growth and regeneration of
    longleaf pine as evidenced by the existing longleaf pine along the refuge's southwestern
    border and on the adjacent national forest.  The following longleaf pine planting
    experiment will provide the refuge with the necessary survival, growth, and recruitment
    data to determine if integration of longleaf pine is a viable option and if so,
    how to maximize the return on their resource investment.",nt"license_title":
